function string_to_key(letter)
{
    switch(letter)
    {
        case("A"):
            return 0;
            
        case("Z"):
            return 1;
            
        case("E"):
            return 2;
            
        case("R"):
            return 3;
            
        case("T"):
            return 4;
            
        case("Y"):
            return 5;
            
        case("U"):
            return 6;
            
        case("I"):
            return 7;
            
        case("O"):
            return 8;
            
        case("P"):
            return 9;
            
        case("Q"):
            return 10;
            
        case("S"):
            return 11;
            
        case("D"):
            return 12;
            
        case("F"):
            return 13;
            
        case("G"):
            return 14;
            
        case("H"):
            return 15;
            
        case("J"):
            return 16;
            
        case("K"):
            return 17;
            
        case("L"):
            return 18;
            
        case("M"):
            return 19;
            
        case("BACK"):
            return 20;
            
        case("W"):
            return 21;
            
        case("X"):
            return 22;
            
        case("C"):
            return 23;
            
        case("V"):
            return 24;
            
        case("B"):
            return 25;
            
        case("N"):
            return 26;
            
        default:
            return 27;
    }
} // function string_to_key(string letter) -> int



document.body.style.border = "5px solid red";
var currentLine = 0;


var keys = document.getElementsByClassName("zutom key");
if (keys.length == 0)
    var keys = document.getElementsByClassName("key");

function keypress(key)
{
    keys[key].click();
} // function keypress(int key) -> void

var cellPos = 0
var goodLetters = new String("");
allCells = document.getElementsByClassName("cell-content zutom");
if (allCells.length == 0)
    allCells = document.getElementsByClassName("cell-content fr");

gridBorders = document.getElementsByClassName("grid-cell border-2");

if (allCells.length > gridBorders.length)
    cellPos = allCells.length - gridBorders.length;


initial = allCells[cellPos].firstChild.textContent;
goodLetters += initial;
worldLenght = gridBorders.length / 6;

//console.log("first letter is " + initial);
//console.log("word length is " + worldLenght);
picked = pick(worldLenght,initial);
function send()
{
    pos = Math.floor(Math.random() * picked.length);
    var word = picked[pos];
    for (var i = 0; i < word.length; i++)
    {
        var key = string_to_key(word[i]);
        keypress(key);
    }
    keypress(string_to_key("ENTER"));
    //console.log("Tried the word " + word);
    picked.splice(pos,1);
    past_word = word;
}
function removeFromPickedGood(char, pos)
{
    var end = picked.length;
    //console.log("removing except : " + char +" at pos : " + pos)
    for (var i = 0; i < end; i++)
    {
        if (picked[i].charAt(pos) != char)
        {
            picked.splice(i,1);
            end--;
            i--;
        }
    }
}

function removeFromPickedBad(char, pos)
{
    var end = picked.length;
    //console.log("removing all : " + char + " at pos : " + pos)
    for (var i = 0; i < end; i++)
    {
        if (picked[i].charAt(pos) == char)
        {
            picked.splice(i,1);
            end--;
            i--;
        }
    }
}

function removeFromPickedNotIncluding(char, pos)
{
    var end = picked.length;
    for (var i = 0; i < end; i++)
    {   
        if (!picked[i].includes(char))
        {
            picked.splice(i,1);
            end--;
            i--;
        }        
    }
}
function update_picked()
{
    var checkLater = new String("");
    for (var i = 1; i < worldLenght; i++)
    {
        //console.log("overall pos = " + (i+cellPos));
        var char = allCells[i + cellPos].firstChild.textContent;
        var classNamed = gridBorders[i + (currentLine * worldLenght)].firstChild.className;
        checkWin();

        //console.log("looking for char at pos: " + (i));
        //console.log("char found: " + char)
        //console.log("Class name of index "+ i + " is: " + classNamed);

        if (classNamed == "cell-content fr r" || classNamed == "cell-content zustom r")
        {
            goodLetters += char;
            //console.log("removing all words without " + char + " at pos: " + i);

            removeFromPickedGood(char,i);
        }
        else if (classNamed == "cell-content fr y" || classNamed == "cell-content zustom y")
        {
            goodLetters += char;
            //console.log("removing all words without " + char + " and " + char + " at pos: " + i);

            removeFromPickedBad(char,i);
            removeFromPickedNotIncluding(char,i);
        }        
        else if (classNamed == "cell-content fr -" || classNamed == "cell-content zustom -")
        {
            checkLater += char;
            //console.log("removing all words with " + char + " at pos: " + i);
            //console.log("Adding: " + char + "to checkLater");
            removeFromPickedBad(char, i);
        }
    }
    for (var i = 0; i < checkLater.length; i++)
    {
        if (!goodLetters.includes(checkLater[i]))
        {
            //console.log("REMOVING ALL WORDS WITH ANY: " + checkLater[i])
            for (var j = 1; j < worldLenght; j++)
                removeFromPickedBad(checkLater[i],j);
        }
    }
    //console.log("Number of possible answers: " + picked.length);
    cellPos += worldLenght;
    currentLine++;
}

function checkWin()
{
    currentCells = document.getElementsByClassName("cell-content zutom");
    if (currentCells.length == 0)
        currentCells = document.getElementsByClassName("cell-content fr");
    if (currentCells.length != allCells.length)
    {    
        throw new Error("Done!");
    }
}
var time = 0
var past_word;
function send_with_delay() 
{
    setTimeout(() => { send(); }, time);
    time += 750;
    setTimeout(() => { checkWin(); }, time);
    time += 100;
    setTimeout(() => { update_picked();}, time);
    time += 750;
}


function start()
{
    send_with_delay();
    send_with_delay();
    send_with_delay();
    send_with_delay();
    send_with_delay();
    send_with_delay();
}
start();
